function Header() {
    return (
        <header className="header">
            <nav>
                <img src="https://www.amata.kz/local/templates/ilab_it_shop/ilab/img/svg/logo_new.svg" alt="logo" title="home" className="logotype" />
            </nav>
        </header>
    )
}

export default Header;
